import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to My Personal Website</h1>
        <p>Hello, I'm Shuohe Ren and i am a full stack developer!</p>
        <p>
          I am a full stack developer, and i have been working on many projects!
        </p>
        <p>
          My favorite programming language is JavaScript, and i have been using
          it for over 10 years!
        </p>
        <p> here is my github link: https://github.com/shuoheren</p>
        <p> here is my leetcode link: https://www.leetcode/shuohe</p>
        <p> i love listening to music and watching TV</p>
      </header>
    </div>
  );
}

export default App;
